/** @format */

const Product = (props) => {
	const { product } = props;
	return (
		<div className='card mb-3 mr-4'>
			<h3 className='card-header text-center'>{product.name}</h3>

			<img src={product.images[0].src} alt='Product image'></img>

			<div className='card-body'>
				<h6 className='card-subtitle text-center'>{product.price}</h6>
				<a href='' className='btn btn-secondary'>
					Voir
				</a>
			</div>
		</div>
	);
};
export default Product;
